obj.object.intro=- Si\u00eau Target \u0111\u01b0\u1ee3c \u00e1p d\u1ee5ng ri\u00eang cho Facebook Ads t\u1ea1i Vi\u1ec7t Nam. Vi\u1ec7c \u00e1p d\u1ee5ng sang c\u00e1c th\u1ecb tr\u01b0\u1eddng kh\u00e1c, ch\u00fang t\u00f4i s\u1ebd c\u00f3 th\u00f4ng b\u00e1o sau. <br/>- Si\u00eau Target cam k\u1ebft t\u1ef7 l\u1ec7 chuy\u1ec3n \u0111\u1ed5i UID th\u00e0nh c\u00f4ng \u0111\u1ea1t t\u1ed1i thi\u1ec3u 85% s\u1ed1 l\u01b0\u1ee3ng th\u00e0nh t\u1ec7p Custom Audiences (t\u1ec7p kh\u00e1ch h\u00e0ng t\u00f9y ch\u1ec9nh). <br/>- Si\u00eau Target ch\u1ec9 t\u00ednh ph\u00ed s\u1ed1 UID \u0111\u01b0\u1ee3c chuy\u1ec3n \u0111\u1ed5i th\u00e0nh c\u00f4ng. S\u1ed1 UID chuy\u1ec3n \u0111\u1ed5i kh\u00f4ng th\u00e0nh c\u00f4ng s\u1ebd \u0111\u01b0\u1ee3c ho\u00e0n tr\u1ea3 trong v\u00f2ng 05 ti\u1ebfng \u0111\u1ed3ng h\u1ed3 sau khi b\u1ea1n upload. </br>- L\u01b0u \u00fd: Kh\u00f4ng x\u00f3a t\u1ec7p \u0111\u1ed1i t\u01b0\u1ee3ng Custom Audiences trong t\u00e0i kho\u1ea3n qu\u1ea3ng c\u00e1o khi ch\u01b0a b\u1ea5m Ho\u00e0n tr\u1ea3 UID.</b>
